import React from 'react';
import './box.css';
import Hats from './bricks';

const Box = ({ valList, cntDays }) => {
  const boxTitles = ['Backlog >', 'Refinement >', 'Design >', 'Development >', 'Testing >', 'Production >'];

  return (
    <div className='hats-buckets'>
      {boxTitles.map((boxTitle, boxIndex) => (
        <Hats key={boxIndex} className={boxTitle} title={boxTitle} value={valList[boxIndex]} cntDays={cntDays}/>
      ))}
    </div>
  );
};

export default Box;
